import React from 'react'

class Workout extends React.Component {
    state = {
        workouts: []
    }

    componentDidMount = () => {
        fetch("/api/workout")
            .then(res => res.json())
            .then(workouts => this.setState({workouts}))
    }



    render() {
        console.log(this.state.workouts);
        return (
            <div>
                <h1>Workout hub</h1>
                <p>All Workouts</p>
                <p><a href="/workout/new">Add new workout</a></p>
            </div>
        )
    }
}

export default Workout
